import React from "react";
import profilePic from "../images/IMG_4334.jpg";

const About = () => {
  return (
    <div>
        <h1 className="text-4xl dark:text-white text-black font-bold font-merriweather text-center py-10">
          About Myself
        </h1>

        <div className="flex justify-center items-center">
          <img
            width={300}
            src={profilePic}
            alt="My profile picture"
          />
          <div class="w-1/3 ml-40 ">
            <h1 className="text-xl dark:text-white text-black font-merriweather">
              Hi! I'm Bara, a second year undergraduate student at the
              University of Toronto. I am currently pursuing a double major in
              Computer Science and Human Biology. My interests include reading,
              playing sports and working out.
            </h1>
        </div>
      </div>
    </div>
  );
};

export default About;
